Nit, please prefer to return early.

if (interface != ..){
   continue;
}

As it saves a scope.

Ok, this is much better, but lets use std::isfinite, to ensure that the value is actually representable.  There's lots of weird nonsensical stuff that doubles can contain.  For example, a cable of length negative infinity would be weird to see.

In a perfect world, we'd do something like

if (!isfinite){
    if isnan{
        return;
    }
    set internal error
    return
}

so that the user could know that the dbus interface contract was broken.  With that said, I'm ok with just isfinite if you don't want to do the above.

